import React,{useEffect,useState} from 'react'
import axios from 'axios';
const KeyInfo = () => {
    const [uname, setuname] = useState();
    useEffect(() => {
        if (sessionStorage.getItem("users") != null) {
            const user = sessionStorage.getItem("users");
            const users = JSON.parse(user);
            setuname(users.uname);
        }
        axios
          .post(process.env.REACT_APP_BACKEND + "/getinfo", { usname })
          .then((res) => {
              console.log(res);
          });
        }, [uname]);
  return (
    <>
            <h3 className="text-center mt-5 shadow-lg p-2">KEY DETAILS</h3>
      <div className="card mt-5 PT-3 form-control">
        <div className="card-body mt-3">
            <h6>Application Name</h6>
        </div>
        </div>
    </>
  )
}

export default KeyInfo
